import React from 'react';
import './card-list.styles.css';

export const CardList = (props, monsters) => {
    console.log(props.name);
    return (

        <div className="card-list">{props.monsters.map((monster) => {
            <h1>{monster.name}</h1>
        })}</div>
    );
};
